import React from 'react';
import styled from 'styled-components';
import Header from './components/Header';
import Navbar from './components/Navbar';
import Searchbar from './components/Search';

const SearchSec = styled.div`
  position: absolute;
  margin-top: 200px;
  display: flex;
  align-items: center;
`;

function App() {
  return (
    <>
      <Navbar />
      <Header />
      <SearchSec>
        <Searchbar />
      </SearchSec>
    </>
  );
}

export default App;
